package com.lxkj.sunentertainmentcity.PictureCarousel;

/**
 * @author Slingge
 * 获取广告解析实体类
 * @time 2016-5-11 下午3:57:24
 */
public class AdvertisementBean {
	
	private String btime;
	private String etime;
	private int id;
	private String src;
	private String timer;
	private int type;
	private int yoyoadinfo_id;
	
	
	public AdvertisementBean() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getBtime() {
		return btime;
	}
	public void setBtime(String btime) {
		this.btime = btime;
	}
	public String getEtime() {
		return etime;
	}
	public void setEtime(String etime) {
		this.etime = etime;
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getSrc() {
		return src;
	}
	public void setSrc(String src) {
		this.src = src;
	}
	public String getTimer() {
		return timer;
	}
	public void setTimer(String timer) {
		this.timer = timer;
	}
	public int getType() {
		return type;
	}
	public void setType(int type) {
		this.type = type;
	}
	public int getYoyoadinfo_id() {
		return yoyoadinfo_id;
	}
	public void setYoyoadinfo_id(int yoyoadinfo_id) {
		this.yoyoadinfo_id = yoyoadinfo_id;
	}
	
}

